import React, {Component} from "react";
interface IProps {
}

export default class Register extends Component {

    componentDidMount() {
        fetch('api/customer/')
            .then(response => response.json())
            .then(data => this.setState({item: data}));
    }

    render() {
        return (<div className='home-wrap'>
            {this.state}
        </div>)
    }
}
